import { DataTypes, Model } from 'sequelize';
import sequelize from './index';

class Notes extends Model {}

Notes.init(
  {
    id: {
      type: DataTypes.BIGINT,
      primaryKey: true,
      allowNull: false,
      autoIncrement: true,
    },
    title: {
      type: DataTypes.STRING,
      allowNull: false,
    },
    text: {
      type: DataTypes.TEXT(20000),
      allowNull: false,
    },
  },
  {
    sequelize,
    tableName: 'notes',
    modelName: 'notes',
  },
);

export default Notes;
